import React from 'react';

import { useSelector } from 'react-redux';
import { selectData } from './reducer';


export const DISPLAY = () => {

    const selectTodos = useSelector(selectData);

    return (
        <div>
            {
                selectTodos.todo.map(
                    each => {
                        return <h3>each</h3>;
                    }   
                )
            }
        </div>
    );
}
